('P6211dd30cb6ea', 'Marathon Skin Black', 'The Marathon family grows with its more formal evolution, but keeping the comfort and the performance of a sneaker. You will not have any problems to land with style. Elegant synthetic technical leather fabric\r\n(Alien technology) and ultralight EVA outsole with rubber parts to improve the grip, and , of course, our characteristic. Ergonomic template of Memory Foam.', 120, );
