('P6211ddfede270', 'Atom Eternal Grape 2.0', 'Here is our best-seller, Atom Eternal. The perfect mix between the comfort and the technical qualities of the sneakers, with the elegant and formal touch of the shoe. Its 2.0 version incorporates a lightweight and extremely comfortable two-color expanded EVA sole, with a slight re-dimensioning of the toe and heel that improve its support and cushioning. The set is completed by its exterior fabric in different colors of elastane foam with interior foam, interior fabric in gray technical mesh, ergonomic insole and laces that match with the exterior.\r\n', 80, ),
('P6211de1c91949', 'Atom Oasis Black', 'After a hard day at the office, full of work and appointments in the noisy city, find your Oasis in the middle of the urban jungle with these sneakers: Discover the comfort of our memory foam insole and feel the cold sand in your feets!', 90, );
