INSERT INTO `product` (`product_id`, `name`, `description`, `price`, `image`) VALUES
('P6211dea3e5cf2', 'Atom Black Boot ', 'Our boot designed for winter. We have thought of everything since it has a microfiber surface with a water repellent finish to resist light rains and a sole with anti-slip rubber pieces. 50% Boot, 50% Atom, 100% Amazing.', 130, ),
