INSERT INTO `product` (`product_id`, `name`, `description`, `price`, `image`) VALUES
('P6211df314629c', 'Material Blue Boot', 'Our interpretation of the classic waterproof boot combined with the strength and aesthetics of a military boot. Outer blue rubbery texture, inner white technical mess, dark grey neoprene neck, ergonomic insole, dark grey Eva foam sole, blue speckled laces.\r\nThe fabric made this boot waterproof.\r\nBoot height: 4 - 5 centimetres over the ankle.', 180, ),
